import { Dialog,Box, Typography } from "@mui/material";


const dialogstyle={
    height:'96%',
    marginTop:'12%',
    width:'60%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'none',
}
const LoginDialogue=()=>{

    return(
        <Dialog open={true} PaperProps={{sx: dialogstyle}}>
             <Box>
                <Box>
                     <Typography>To use WhatsApp on your computer:</Typography>
                </Box>
                <Box>

                </Box>
             </Box>
        </Dialog>
    )
}
export default LoginDialogue;
